import React from 'react';
import {NavLink} from 'react-router-dom'
import Image from '../../../assets/images/todo.png'

function Header(){
    return (
        <header>
            <nav className="nav--navbar">
                <NavLink to="/"><img src={Image} alt="Home"/></NavLink>
            </nav>
        </header>
    )
}

export default Header;
